public class DataBinderMapperImpl extends DataBinderMapper {
  private static final int LAYOUT_FRAGMENTGALLERYFULLSCREEN = 1;

  private static final int LAYOUT_FRAGMENTSCREENSLIDEPAGE = 2;

  private static final int LAYOUT_FRAGMENTTOUCHVIEW = 3;

  private static final int LAYOUT_IMAGEFRAGMENT = 4;

  private static final int LAYOUT_ITEMGALLERYIMAGE = 5;

  private static final int LAYOUT_MAINFRAGMENT = 6;

  private static final SparseIntArray INTERNAL_LAYOUT_ID_LOOKUP = new SparseIntArray(6);

  static {
    INTERNAL_LAYOUT_ID_LOOKUP.put(com.getcapacitor.community.media.photoviewer.R.layout.fragment_gallery_fullscreen, LAYOUT_FRAGMENTGALLERYFULLSCREEN);
    INTERNAL_LAYOUT_ID_LOOKUP.put(com.getcapacitor.community.media.photoviewer.R.layout.fragment_screen_slide_page, LAYOUT_FRAGMENTSCREENSLIDEPAGE);
    INTERNAL_LAYOUT_ID_LOOKUP.put(com.getcapacitor.community.media.photoviewer.R.layout.fragment_touchview, LAYOUT_FRAGMENTTOUCHVIEW);
    INTERNAL_LAYOUT_ID_LOOKUP.put(com.getcapacitor.community.media.photoviewer.R.layout.image_fragment, LAYOUT_IMAGEFRAGMENT);
    INTERNAL_LAYOUT_ID_LOOKUP.put(com.getcapacitor.community.media.photoviewer.R.layout.item_gallery_image, LAYOUT_ITEMGALLERYIMAGE);
    INTERNAL_LAYOUT_ID_LOOKUP.put(com.getcapacitor.community.media.photoviewer.R.layout.main_fragment, LAYOUT_MAINFRAGMENT);
  }

  @Override
  public ViewDataBinding getDataBinder(DataBindingComponent component, View view, int layoutId) {
    int localizedLayoutId = INTERNAL_LAYOUT_ID_LOOKUP.get(layoutId);
    if(localizedLayoutId > 0) {
      final Object tag = view.getTag();
      if(tag == null) {
        throw new RuntimeException("view must have a tag");
      }
      switch(localizedLayoutId) {
        case  LAYOUT_FRAGMENTGALLERYFULLSCREEN: {
          if ("layout/fragment_gallery_fullscreen_0".equals(tag)) {
            return new FragmentGalleryFullscreenBindingImpl(component, view);
          }
          throw new IllegalArgumentException("The tag for fragment_gallery_fullscreen is invalid. Received: " + tag);
        }
        case  LAYOUT_FRAGMENTSCREENSLIDEPAGE: {
          if ("layout/fragment_screen_slide_page_0".equals(tag)) {
            return new FragmentScreenSlidePageBindingImpl(component, view);
          }
          throw new IllegalArgumentException("The tag for fragment_screen_slide_page is invalid. Received: " + tag);
        }
        case  LAYOUT_FRAGMENTTOUCHVIEW: {
          if ("layout/fragment_touchview_0".equals(tag)) {
            return new FragmentTouchviewBindingImpl(component, view);
          }
          throw new IllegalArgumentException("The tag for fragment_touchview is invalid. Received: " + tag);
        }
        case  LAYOUT_IMAGEFRAGMENT: {
          if ("layout/image_fragment_0".equals(tag)) {
            return new ImageFragmentBindingImpl(component, view);
          }
          throw new IllegalArgumentException("The tag for image_fragment is invalid. Received: " + tag);
        }
        case  LAYOUT_ITEMGALLERYIMAGE: {
          if ("layout/item_gallery_image_0".equals(tag)) {
            return new ItemGalleryImageBindingImpl(component, view);
          }
          throw new IllegalArgumentException("The tag for item_gallery_image is invalid. Received: " + tag);
        }
        case  LAYOUT_MAINFRAGMENT: {
          if ("layout/main_fragment_0".equals(tag)) {
            return new MainFragmentBindingImpl(component, view);
          }
          throw new IllegalArgumentException("The tag for main_fragment is invalid. Received: " + tag);
        }
      }
    }
    return null;
  }

  @Override
  public ViewDataBinding getDataBinder(DataBindingComponent component, View[] views, int layoutId) {
    if(views == null || views.length == 0) {
      return null;
    }
    int localizedLayoutId = INTERNAL_LAYOUT_ID_LOOKUP.get(layoutId);
    if(localizedLayoutId > 0) {
      final Object tag = views[0].getTag();
      if(tag == null) {
        throw new RuntimeException("view must have a tag");
      }
      switch(localizedLayoutId) {
      }
    }
    return null;
  }

  @Override
  public int getLayoutId(String tag) {
    if (tag == null) {
      return 0;
    }
    Integer tmpVal = InnerLayoutIdLookup.sKeys.get(tag);
    return tmpVal == null ? 0 : tmpVal;
  }

  @Override
  public String convertBrIdToString(int localId) {
    String tmpVal = InnerBrLookup.sKeys.get(localId);
    return tmpVal;
  }

  @Override
  public List<DataBinderMapper> collectDependencies() {
    ArrayList<DataBinderMapper> result = new ArrayList<DataBinderMapper>(1);
    result.add(new androidx.databinding.library.baseAdapters.DataBinderMapperImpl());
    return result;
  }

  private static class InnerBrLookup {
    static final SparseArray<String> sKeys = new SparseArray<String>(1);

    static {
      sKeys.put(0, "_all");
    }
  }

  private static class InnerLayoutIdLookup {
    static final HashMap<String, Integer> sKeys = new HashMap<String, Integer>(6);

    static {
      sKeys.put("layout/fragment_gallery_fullscreen_0", com.getcapacitor.community.media.photoviewer.R.layout.fragment_gallery_fullscreen);
      sKeys.put("layout/fragment_screen_slide_page_0", com.getcapacitor.community.media.photoviewer.R.layout.fragment_screen_slide_page);
      sKeys.put("layout/fragment_touchview_0", com.getcapacitor.community.media.photoviewer.R.layout.fragment_touchview);
      sKeys.put("layout/image_fragment_0", com.getcapacitor.community.media.photoviewer.R.layout.image_fragment);
      sKeys.put("layout/item_gallery_image_0", com.getcapacitor.community.media.photoviewer.R.layout.item_gallery_image);
      sKeys.put("layout/main_fragment_0", com.getcapacitor.community.media.photoviewer.R.layout.main_fragment);
    }
  }
}
